-- I dati devono esser già stati acquisiti con anche gli swimmers
UPDATE meeting_relay_swimmers SET minutes = 0, seconds = 33, hundreds = 26 WHERE id > 0 and id = (select a.id from (select mrs.id from meeting_relay_swimmers mrs join meeting_relay_results mrr on mrr.id = mrs.meeting_relay_result_id join meeting_programs mp on mp.id = mrr.meeting_program_id join meeting_events me on me.id = mp.meeting_event_id  join meeting_sessions ms on ms.id = me.meeting_session_id join event_types et on et.id = me.event_type_id join swimmers s on s.id = mrs.swimmer_id where ms.meeting_id = 16101 and  s.complete_name = 'STORCHI LORENZO' and et.code = 'S4X50MI') a);
